import React from "react";
import Icon from "../Icon";

const Footer = () => {
  return (
    <div className="footer">
      <div className="footer-item"></div>
      <div className="footer-item">
        <Icon name="fa-copyright" size="fa-lg" />
        <span>2022 Versy</span>
      </div>
    </div>
  );
};

export default Footer;
